    <script>
        
        $('body').on('click', '#reloadbtn', function () {
            
            $('#reloadbtn').html('<i class="fa fa-refresh fa-spin"></i> <i class="fa fa"> Reload</i>');
            var current_page = localStorage.getItem('current_page');
            
            if(current_page == 0 || current_page == '' || current_page == null)
            {
                window.location.href = '<?php echo $defaultUrl;?>app/home';
            }
            else
            {
                window.location.href = current_page;
            }
            
        });
        
        $(document).ready(function() {
    
            var url = localStorage.getItem('current_page');
            
            // Function to check internet connection status
            function checkInternetConnection() {
                if (navigator.onLine) {
                    window.location.href = url;
                } else {
                    window.location.href = '<?php echo $defaultUrl;?>no-internet';
                }
            }
        
            // Initial check
            checkInternetConnection();
        
            // Event listener for online/offline status changes
            $(window).on('online offline', checkInternetConnection);
        });
    </script>
    
